// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract SolidVote {
    uint256 constant MAX_UINT256 = 2**256 - 1;

    struct Candidate {
        string name;
        uint48 votes;
    }

    struct Voter {
        uint32 votedFor;
        bool authorized;
        bool voted;
        uint256 nonce;
    }

    struct Ballot {
        string label;
        address owner;
        Candidate[] candidate;
        uint8 numberOfCandidates;
        bool openElection;
        mapping(address => Voter) voter;
        string message;
        bool votingOpen;
    }

    address private owner;

    mapping(bytes32 => Ballot) public ballot;

    modifier onlyOwner() {
        require(msg.sender == owner, "Caller is not the owner");
        _;
    }

    constructor() {
        owner = msg.sender;
    }

    function getNonce(bytes32 ballotID) public view returns(uint256) {
        return ballot[ballotID].voter[msg.sender].nonce;
    }

    function getMyVote(bytes32 ballotID) public view returns (string memory, uint32) {
        bool voted = ballot[ballotID].voter[msg.sender].voted;
        require (voted == true, "You haven't voted, check account address");
        uint32 votedFor = ballot[ballotID].voter[msg.sender].votedFor;
        return (ballot[ballotID].candidate[votedFor].name, votedFor);
    }
    
    function voteFor(bytes32 ballotID, uint32 vote, uint256 nonce) public {
        require(nonce == ballot[ballotID].voter[msg.sender].nonce, "Nonce error, replay attack.");
        require (ballot[ballotID].candidate[vote].votes < MAX_UINT256, "Max number of votes reached, thats more than stars in the universe! I suspect an attack.");
        require(bytes(ballot[ballotID].candidate[vote].name).length > 0, "Invalid vote, candidate doesn't exist.");
        if (ballot[ballotID].openElection == false) {
            require(ballot[ballotID].voter[msg.sender].authorized == true, "This address is not authorized.");
        }
        if (ballot[ballotID].voter[msg.sender].voted != true) {
            ballot[ballotID].voter[msg.sender].voted = true;
            ballot[ballotID].candidate[vote].votes++;
        } else {
            require(ballot[ballotID].voter[msg.sender].votedFor != vote, "Same vote as recorded on chain.");
            ballot[ballotID].candidate[ballot[ballotID].voter[msg.sender].votedFor].votes--;
            ballot[ballotID].candidate[vote].votes++;
        }
        ballot[ballotID].voter[msg.sender].votedFor = vote;
        if (ballot[ballotID].voter[msg.sender].nonce < MAX_UINT256) { 
            ballot[ballotID].voter[msg.sender].nonce++; 
        } else {
            ballot[ballotID].voter[msg.sender].nonce = 0;
        }
    }

    function getVoteTotals(bytes32 ballotID) public view returns (string[] memory, uint48[] memory) {
        uint8 numberOfCandidates = ballot[ballotID].numberOfCandidates;
        string[] memory candidateNames = new string[](numberOfCandidates);
        uint48[] memory voteTotals = new uint48[](numberOfCandidates);
        
        for (uint8 i = 0; i < ballot[ballotID].numberOfCandidates; i++) {
            candidateNames[i] = ballot[ballotID].candidate[i].name;
            voteTotals[i] = ballot[ballotID].candidate[i].votes;
        }
        return (candidateNames, voteTotals);
    }
    
    function createBallot (
        bytes32 ballotID, string[] memory listOfCandidates, address[] memory listOfApprovedVoters, 
        string memory ballotLabel, string memory ballotMessage, bool ballotOpenElection) public {

        require(listOfCandidates.length < 255, "Maximum 256 candidates");
        require(listOfCandidates.length > 0, "No candidates sent");

        if (ballot[ballotID].owner == address(0) && ballot[ballotID].owner != msg.sender) {
            setOwnershipOfBallot(ballotID);
        }
        addCandidatesToBallot(ballotID, listOfCandidates);
        addApprovedVotersToBallot(ballotID, listOfApprovedVoters);
        addLabelToBallot(ballotID, ballotLabel);
        addMessageToBallot(ballotID, ballotMessage);
        if (ballotOpenElection) {
            setOpenElection(ballotID);
        } else {
            setClosedElection(ballotID);
        }
    }

    function checkForBallot (bytes32 ballotID) public view returns(bool) {
        if (ballot[ballotID].owner == address(0)) {
            return false;
        } else{
            return true;
        }
    }
    function getBallot (bytes32 ballotID) public view returns(string memory, string[] memory, string memory, bool) {
        string[] memory listOfCandidates;
        listOfCandidates = new string[](ballot[ballotID].candidate.length);
        for (uint8 i = 0; i < ballot[ballotID].candidate.length; i++) {
            listOfCandidates[i] = ballot[ballotID].candidate[i].name;
        }
        return (ballot[ballotID].label, listOfCandidates, ballot[ballotID].message, ballot[ballotID].openElection);
    }

    function setOwnershipOfBallot (bytes32 ballotID) private {
        require(ballot[ballotID].owner == address(0), "BallotID already in use, get a new ballotID");
        ballot[ballotID].owner = msg.sender;
    }

    function setClosedElection(bytes32 ballotID) private {
        require(ballot[ballotID].owner == msg.sender);
        require(ballot[ballotID].votingOpen == false);
        ballot[ballotID].openElection = false;
    }
    function setOpenElection(bytes32 ballotID) private {
        require(ballot[ballotID].owner == msg.sender);
        ballot[ballotID].openElection = true;
    }
    function addMessageToBallot(bytes32 ballotID, string memory ballotMessage) private {
        require(ballot[ballotID].owner == msg.sender);
        ballot[ballotID].message = ballotMessage;
    }
    function addLabelToBallot(bytes32 ballotID, string memory ballotLabel) private {
        require(ballot[ballotID].owner == msg.sender);
        ballot[ballotID].label = ballotLabel;
    }
    function addApprovedVotersToBallot(bytes32 ballotID, address[] memory listOfApprovedVoters) private {
        require(ballot[ballotID].owner == msg.sender);
        for ( uint8 i = 0; i < listOfApprovedVoters.length; i++ ) {
            ballot[ballotID].voter[listOfApprovedVoters[i]].authorized = true;
        }
    }
    function addCandidatesToBallot(bytes32 ballotID, string[] memory listOfCandidates) private {
        require(ballot[ballotID].owner == msg.sender);
        for ( uint8 i = 0; i < listOfCandidates.length; i++ ) {
            ballot[ballotID].candidate.push(Candidate(listOfCandidates[i], 0));
        }
        ballot[ballotID].numberOfCandidates = uint8(ballot[ballotID].candidate.length);
    }

    function createBallotID() public view returns(bytes32) {
        bytes32 id = keccak256(abi.encodePacked(msg.sender, block.timestamp));
        return(id);
    }

}
